import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import CreatePackage from './CreatePackage';
import ViewMyPackages from './ViewMyPackages';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Package Management</h1>
        <nav>
          <ul>
            <li>
              <Link to="/create-package">Create Package</Link>
            </li>
            <li>
              <Link to="/view-my-packages">View My Packages</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/create-package" element={<CreatePackage />} />
          <Route path="/view-my-packages" element={<ViewMyPackages />} />
        </Routes>
      </div>
    </Router>
  );
};
const styles = {
  app: {
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#fdf7f2', // Bej deschis
    padding: '20px',
  },
  heading: {
    textAlign: 'center',
    color: '#d39db7',
  },
  nav: {
    marginBottom: '20px',
    textAlign: 'center',
  },
  navList: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    gap: '20px',
  },
  navItem: {
    display: 'inline-block',
  },
  link: {
    textDecoration: 'none',
    color: '#7d7d7d', // Gri deschis
    fontWeight: 'bold',
    padding: '10px 20px',
    borderRadius: '5px',
    backgroundColor: '#fbeef0', // Roz deschis
    transition: 'background-color 0.3s',
  },
  linkHover: {
    backgroundColor: '#d39db7',
    color: '#fff',
  },
};
export default App;
